INSERT INTO `events` VALUES (1,'Manager Mayhem','IT Manager','Good at commandeering people around without them realising? Don\'t brag about it, come show us! This event will either make you or break you.','not available','$2y$10$IHCxK8P/A3UwO3qhlU9hEuP1oxHFr4hcj94bRpdPzRy/uxIuDIAJ2','Day 1:<br>11:00AM-1:00PM,<br>2:00PM-5:00PM<hr>Day 2:<br>9:00AM-1:00PM,<br>2:00PM-3:30PM<br>',0,'1','Carl','7019922101','/nevada/nevada1/logoss/png_icons/itmanager.png','<p style=\"color: rgb(219, 82, 82); text-align: justify;\"><i>\n								Good at commandeering people around without them realising? Don\'t brag about it, come show us! This event will either make you or break you.\n								</i>\n							</p>\n							<h4>Rules:</h4>\n					  		<p><ul>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Each team can have 1 participant.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Participants are NOT allowed to participate in any other Event.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Participants are required to carry their own laptop.</li><br>\n					  		</ul></p>','Each team can have 1 participant.\n\nParticipants are NOT allowed to participate in any other Event.\n\nParticipants are required to carry their own laptop.\n','2018-09-05 23:58:25','2018-09-05 23:58:25'),(2,'Release Edition','Product Launch','Create a solution that the market needs or create a market for your solution. Design the product of your dreams.','not available','$2y$10$J04YlBu/yIw6e4RSg71JLeg9djJpZyp9pusZaFylz47rRi3pvjij.','Day 1:<br>12:00PM-1:00PM<hr>Day 2:<br>11:00AM-1:00PM',1,'2','Anish','9741666811','/nevada/nevada1/logoss/png_icons/product.png','<p style=\"color: rgb(219, 82, 82); text-align: justify;\"><i>\n								Create a solution that the market needs or create a market for your solution. Design the product of your dreams.\n								</i>\n							</p>\n							<h4>Rules:</h4>\n					  		<p><ul>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Each team can have a maximum of 2 members.</li>\n					  				<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Teams will be given 10-15 mins to discuss on the product before pitching the idea.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Any changes in the event details would be informed on spot.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Each team must stick to the time limit.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The decision of the judges will be considered as the final decision.</li>\n									<br>\n					  		</ul></p>','Each team can have a maximum of 2 members.\n\nTeams will be given 10-15 mins to discuss on the product before pitching the idea.\n\nAny changes in the event details would be informed on spot.\n\nEach team must stick to the time limit.\n\nThe decision of the judges will be considered as the final decision.\n','2018-09-05 23:58:26','2018-09-05 23:58:26'),(3,'Bug Smash','Coding and Debugging','Think in JAVA, dream in C and debug the world around you? Come show us your ways with Sensei.','BCA Lab','$2y$10$a2Tx7A9jkW7GmGA27bCSO.pe4dc8ZeeulPT4ZkW7tVTAbivtrr066','Day 1:<br>2:00PM-3:00PM,<br>4:00PM-7:00PM<hr>Day 2:<br>11:00AM-1:00PM',1,'2','Himanshu','8861847120','/nevada/nevada1/logoss/png_icons/coding.png','<p style=\"color: rgb(219, 82, 82); text-align: justify;\"><i>\n								Think in JAVA, dream in C and debug the world around you? Come show us your ways with Sensei.\n								</i>\n							</p>\n							<h4>Rules:</h4>\n					  		<p><ul>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; 2 members per team.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Maximum of 2 teams per college.</li><br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Systems will be provided.</li><br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Internet usage is strictly prohibited.</li><br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Participants can code in any of the following languages: C, C++, Java or Python.</li><br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Time taken to solve each problem will be noted.</li><br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The lines of code and logic used will be noted.</li><br>\n					  		</ul></p>','2 members per team.\n\nMaximum of 2 teams per college.\n\nSystems will be provided.\n\nInternet usage is strictly prohibited.\n\nParticipants can code in any of the following languages: C, C++, Java or Python.\n\nTime taken to solve each problem will be noted.\n\nThe lines of code and logic used will be noted.\n','2018-09-05 23:58:26','2018-09-05 23:58:26'),(4,'Verbal Wars','Mock Parliament','Do you argue at the top of your voice even if you know you\'re wrong? Welcome to the government.','not available','$2y$10$IiKTqltRlnDs.IP/x4CCAe36vVfiTLZypY1Pzd5dr87ot/MTNZwqK','Day 1:<br>11:00AM-1:00PM,<br>2:00PM-5:00PM',1,'3 - 6','Pratiksha','9979782005','/nevada/nevada1/logoss/png_icons/mockparliament.png','<p style=\"color: rgb(219, 82, 82); text-align: justify;\"><i>\n								Do you argue at the top of your voice even if you know you\'re wrong? Welcome to the government.\n								</i>\n							</p>\n							<h4>Rules:</h4>\n					  		<p><ul>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Maximum of 2 teams per college.</li>\n					  				<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; No. of members per team: 2</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Topics of discussion will be given on the spot.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Teams will be given 5 mins to discuss on the topic.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Any variation in the proceedings will be informed on the spot.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The speaker will be allotting time and turns to put forth points by a team.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Students are not supposed to use slangs in any context.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Students are advised to hold on to the time limit given by the speaker.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The decision of the judges will be considered as the final decision.</li>\n									<br>\n					  		</ul></p>','Maximum of 2 teams per college.\n\nNo. of members per team: 2\n\nTopics of discussion will be given on the spot.\n\nTeams will be given 5 mins to discuss on the topic.\n\nAny variation in the proceedings will be informed on the spot.\n\nThe speaker will be allotting time and turns to put forth points by a team.\n\nStudents are not supposed to use slangs in any context.\n\nStudents are advised to hold on to the time limit given by the speaker.\n\nThe decision of the judges will be considered as the final decision.\n','2018-09-05 23:58:26','2018-09-05 23:58:26'),(5,'Freeze Frame','Photography','You can be the next Okanisakikama. Just take an intriguing snapshot of the world around you and express it with a photograpgh. BTW, that person in the first sentence doesn\'t exist.','not available','$2y$10$LLHRgwC2IgtiXAF..kKXr.VcQQMsALQDVcXS05WVCfl6GwdpDLtim','Day 2:<br>9:00AM-1:00PM,<br>2:00PM-3:00PM<br>',0,'1','Thomas','8769108122','/nevada/nevada1/logoss/png_icons/photography.png','<p style=\"color: rgb(219, 82, 82); text-align: justify;\"><i>\n								You can be the next Okanisakikama. Just take an intriguing snapshot of the world around you and express it with a photograpgh. BTW, that person in the first sentence doesn\'t exist.\n								</i>\n							</p>\n							<h4>Rules:</h4>\n					  		<p><ul>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Only one participates from one college.</li>\n					  				<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Picture can be taken from Any device or iPhone, you can also use DSLR but picture format must be RAW.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Picture should be captured only within the university premises.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Editing is allowed only with LIGHTROOM. (DETAILS will be checked of file).</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Caption is mandatory. (NOTE - CAPTION & TOPIC are different, caption will describe the story of the picture and picture must be taken based on TOPIC).</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; One participates can submit only one picture for contest with ORIGINAL AND EDITIED FILES.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Topic and time limit will be introduced at the time of INAUGRATION CEREMONY.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The picture submission folder name must your first name and then college name, ex: THOMASCHRIST and inside of that folder create artist_detail.txt and add details (NAME, COURSE AND SEMESTER and COLLEGE NAME) of photographer.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; If any image is downloaded or copied from any other source, that participate will be eliminated immediately.</li>\n									<br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Photographs should be submitted within the time allotted (3 pm to 3: 30 pm)</li>\n									<br>\n					  		</ul></p>','Only one participates from one college.\n\nPicture can be taken from Any device or iPhone, you can also use DSLR but picture format must be RAW.\n\nPicture should be captured only within the university premises.\n\nEditing is allowed only with LIGHTROOM. (DETAILS will be checked of file).\n\nCaption is mandatory. (NOTE - CAPTION & TOPIC are different, caption will describe the story of the picture and picture must be taken based on TOPIC).\n\nOne participates can submit only one picture for contest with ORIGINAL AND EDITIED FILES.\n\nTopic and time limit will be introduced at the time of INAUGRATION CEREMONY.\n\nThe picture submission folder name must your first name and then college name, ex: THOMASCHRIST and inside of that folder create artist_detail.txt and add details (NAME, COURSE AND SEMESTER and COLLEGE NAME) of photographer.\n\nIf any image is downloaded or copied from any other source, that participate will be eliminated immediately.\n\nPhotographs should be submitted within the time allotted (3 pm to 3: 30 pm)\n','2018-09-05 23:58:26','2018-09-05 23:58:26'),(6,'Click - Bait','AD Making','You know those annoying things that interrupt your videos for 10 seconds? Be on the money making side of them.','not available','$2y$10$JakLpBDTHNobDxGLoH3jVundsj1e1Xkj2j4BCQbnd14LEetllGYSK','Day 1:<br>11:00AM-1:00PM,<br>2:00PM-5:00PM<hr>Day 2:<br>9:00AM-1:00PM,<br>2:00PM-3:00PM<br>',1,'2','Tony','9902771821','/nevada/nevada1/logoss/png_icons/admaking.png','<p style=\"color: rgb(219, 82, 82); text-align: justify;\"><i>\n								You know those annoying things that interrupt your videos for 10 seconds? Be on the money making side of them.\n								</i>\n							</p>\n							<h4>Rules:</h4>\n					  		<p><ul>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Maximum 2 participants in a team.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Maximum 2 teams per college.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The topic for the ad will be given to the participants in the respective venue. </li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The video must be shot within the campus premise of Christ University. </li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Participants must bring their own camera, laptop, usb drive or any other gadgets necessary for the ad making. </li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The video shall not contain any vulgar remark or act.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The duration of the video should be minimum  30 seconds and maximum 1 minute including all titles and credits. </li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The playback format of the video must be in mp4.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The video must be submitted to the event coordinators in a usb drive on the 2nd day between 1.30pm and 2pm.</li><br>\n					  		</ul></p>','Maximum 2 participants in a team.\n\nMaximum 2 teams per college.\n\nThe topic for the ad will be given to the participants in the respective venue. \n\nThe video must be shot within the campus premise of Christ University. \n\nParticipants must bring their own camera, laptop, usb drive or any other gadgets necessary for the ad making. \n\nThe video shall not contain any vulgar remark or act.\n\nThe duration of the video should be minimum  30 seconds and maximum 1 minute including all titles and credits. \n\nThe playback format of the video must be in mp4.\n\nThe video must be submitted to the event coordinators in a usb drive on the 2nd day between 1.30pm and 2pm.\n','2018-09-05 23:58:26','2018-09-05 23:58:26'),(7,'Game - O - Tronix','Gaming','AFK. CLUTCH ACE. NOICE. GGWP. n1. www.downloadfreessd.com. HAX. AIMBOT. If you can decode these, then this is where you belong.','MCA Lab\nMSC Lab','$2y$10$kDWPauCCKJYHdmk59FK5LOnKUsUZXmDiGROGb2jXk9qEdAUcZoP5.','Day 1:<br>11:00AM-1:00PM,<br>2:00PM-7:00PM<hr>Day 2:<br>9:00AM-1:00PM',1,'CS: 5\nFIFA: 1\nBLUR: 2','Ankit','8123107440','/nevada/nevada1/logoss/png_icons/gaming.png','<p style=\"color: rgb(219, 82, 82); text-align: justify;\"><i>\n								AFK. CLUTCH ACE. NOICE. GGWP. n1. www.downloadfreessd.com. HAX. AIMBOT. If you can decode these, then this is where you belong.\n								</i>\n							</p>\n							<h4>Games:</h4>\n							<p class=\"no-padding\">\n								<div class=\"row\">\n									<div class=\"col-md-6 col-md-offset-1\">\n										<table style=\"border-style: hidden;\" class=\"table-responsive\" width=\"100%\">\n											<tr style=\"border-style: hidden;\">\n												<td style=\"border-style: hidden;\"><strong><i class=\"fa fa-soccer-ball-o\" style=\"color: rgb(219, 82, 82);\"></i></strong></td>\n												<td style=\"border-style: hidden;\">FIFA \'18</td>\n												<td style=\"border-style: hidden;\">1 Player</td>\n											</tr>\n											<tr style=\"border-style: hidden;\">\n												<td style=\"border-style: hidden;\"><strong><i class=\"fa fa-cab\" style=\"color: rgb(219, 82, 82);\"></i></strong></td>\n												<td style=\"border-style: hidden;\">Blur</td>\n												<td style=\"border-style: hidden;\">2 Players</td>\n											</tr>\n											<tr style=\"border-style: hidden;\">\n												<td style=\"border-style: hidden;\"><strong><i class=\"fa fa-crosshairs\" style=\"color: rgb(219, 82, 82);\"></i></strong></td>\n												<td style=\"border-style: hidden;\">Counter Strike 1.6</td>\n												<td style=\"border-style: hidden;\">5 Players</td>\n											</tr>\n										</table>\n									</div>\n								</div>\n							</p>\n							<h4>Rules:</h4>\n					  		<p><ul>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; The above mentioned games will be played as 3 different events.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; All three events will start simultaneously.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Players are not allowed to switch between game events.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Players can only participate in one Event (CS, FIFA or Blur). Therefore a college can have maximum of 8 participants (1 for Fifa, 2 for Blur, 5 for CS).</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Participants are suggested bring their own peripherals (mouse, earphone, controller etc.). If the participant is unable to bring his own peripherals, generic peripherals will be provided.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; If a participant damages any peripherals provided, he/she will be held responsible.</li><br>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Raging is not encouraged. Raging unnecessarily can get participants disqualified.</li><br>\n					  		</ul></p>','The above mentioned games will be played as 3 different events.\n\nAll three events will start simultaneously.\n\nPlayers are not allowed to switch between game events.\n\nPlayers can only participate in one Event (CS, FIFA or Blur). Therefore a college can have maximum of 8 participants (1 for Fifa, 2 for Blur, 5 for CS).\n\nParticipants are suggested bring their own peripherals (mouse, earphone, controller etc.). If the participant is unable to bring his own peripherals, generic peripherals will be provided.\n\nIf a participant damages any peripherals provided, he/she will be held responsible.\n\nRaging is not encouraged. Raging unnecessarily can get participants disqualified.\n','2018-09-05 23:58:26','2018-09-05 23:58:26'),(8,'Gold Rush','Treasure Hunt','Love sniffing out clues? Consider yourself a detective? Wanna be puzzled? Requirements: Wit, a magnifying glass and a sidekick. Recommend: Comfortable shoes.','not available','$2y$10$PX.f3rqXN4esixudzdCJbu9zwarHNJcuXRAZJKP7Y/EZzkocFimiu','not available',1,'3','Amrita','7204365350','/nevada/nevada1/logoss/png_icons/treasurehunt.png','<p style=\"color: rgb(219, 82, 82); text-align: justify;\"><i>\n								Love sniffing out clues? Consider yourself a detective? Wanna be puzzled?\n								<br>Requirements: Wit, a magnifying glass and a sidekick.\n								<br><u>Recommend</u>: Comfortable shoes.\n								</i>\n							</p>\n							<h4>Rules:</h4>\n					  		<p><ul>\n					  				<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Maximum of 2 teams per college.</li><br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Team of 3 players. 2 players are mandatory for each round.</li><br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Electronic devices are not allowed.</li><br>\n									<li><i class=\"fa fa-check\" style=\"color: rgb(219, 82, 82);\"></i> &nbsp; Violation of general code of conduct will lead to disqualification of participants 